class Point{
	constructor (x, y, s, r){
		this.x = x;
		this.y = y;
		this.s = s;
		this.r = r;
	}
}

class ArrowPathAnimationEvent{
	constructor (point1, point2, initialScale){
		this.point1 = point1;
		this.point2 = point2;
		
		this.initialScale = initialScale;
	}
}

class ArrowHitHintAnimationEvent{
	constructor (arrowHitHintDomObject, point1, point2, xPosFunc, yPosFunc, animationDuration){
		this.arrowHitHintDomObject = arrowHitHintDomObject;
		this.point1 = point1;
		this.point2 = point2;
		this.xPosFunc = xPosFunc;
		this.yPosFunc = yPosFunc;
		this.animationDuration = animationDuration;
	}
	execute(){
		if(this.arrowHitHintDomObject != null){
			this.animationDuration = this.animationDuration <= 0 ? 1 : this.animationDuration;

			var step = 1 / this.animationDuration

			var currFrame = 0;
			//var id = currentArrowHitHintAnimationEvents;
			var id = this.arrowHitHintDomObject;

			//set animation function
			arrowHitHintCurrentAnimationMap.set(id, () => {
				if (currFrame >= this.animationDuration) {
					arrowHitHintCurrentAnimationMap.delete(id)
				}
				
				var currX = this.xPosFunc(this.point1.x, this.point2.x, step * currFrame);
				var currY = this.yPosFunc(this.point1.y, this.point2.y, step * currFrame);
				var currS = (this.point2.s - this.point1.s) * step * currFrame + this.point1.s;
				var currR = (this.point2.r - this.point1.r) * step * currFrame + this.point1.r;

				this.arrowHitHintDomObject.style.left = currX + 'px';
				this.arrowHitHintDomObject.style.top = currY + 'px';
				this.arrowHitHintDomObject.style.scale = currS;
				this.arrowHitHintDomObject.style.rotate = currR + 'deg';

				currFrame++;
			});
		}
	}
}

